const ContactList = (filteredContacts) => {
    return (
        <ul>
            {
                filteredContacts.map((contact, index) => {
                    <li key={index}>{contact.name}: {contact.number} <button className="delete">Delete</button></li>
                })
            }
        </ul>
    )
}

export default ContactList;
